void swt_per_stride(int M, double *inp, int N, double *lpd, double*hpd, int lpd_len, double *cA, int len_cA, double *cD, int istride, int ostride) {
	int l, l2, isodd, i, t, len_avg, j;
	int is, os;
	len_avg = M * lpd_len;
	l2 = len_avg / 2;
	isodd = N % 2;

	for (i = 0; i < len_cA; ++i) {
		t = i + l2;
		os = i *ostride;
		cA[os] = 0.0;
		cD[os] = 0.0;
		l = -1;
		for (j = 0; j < len_avg; j += M) {
			l++;
			while (j >= len_cA) {
				j -= len_cA;
			}
			if ((t - j) >= l2 && (t - j) < N) {
				is = (t - j)*istride;
				cA[os] += lpd[l] * inp[is];
				cD[os] += hpd[l] * inp[is];
			}
			else if ((t - j) < l2 && (t - j) >= 0) {
				is = (t - j)*istride;
				cA[os] += lpd[l] * inp[is];
				cD[os] += hpd[l] * inp[is];
			}
			else if ((t - j) < 0) {
				is = (t - j + N)*istride;
				cA[os] += lpd[l] * inp[is];
				cD[os] += hpd[l] * inp[is];
			}
			else if ((t - j) >= N && isodd == 0) {
				is = (t - j - N)*istride;
				cA[os] += lpd[l] * inp[is];
				cD[os] += hpd[l] * inp[is];
			}
			else if ((t - j) >= N && isodd == 1) {
				if (t - l != N) {
					is = (t - j - (N + 1))*istride;
					cA[os] += lpd[l] * inp[is];
					cD[os] += hpd[l] * inp[is];
				}
				else {
					is = (N - 1)*istride;
					cA[os] += lpd[l] * inp[is];
					cD[os] += hpd[l] * inp[N - 1];
				}
			}

		}
	}

}

